question.answer:
#include <stdio.h>

int main(void)
{
	char input, result;
	int steps;

	printf("Enter letter:\n");
	scanf("%c", &input);

	printf("Enter steps:\n");
	scanf("%d", &steps);

	result = (int)input - 'A';
	result = (char)((result + steps) % 26) + 'A';

	printf("%c -- %d --> %c", input, steps, result);

	return 0;
}
